      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE ( - 50 / col2 * 16 * + col0 - - 58 * + col0 ) NOT BETWEEN NULL AND - 0 * + ( 20 );
  - name: tab2

outputs:
